import React, { useEffect, useState } from 'react';
import {
  TextField,
  Button,
  Box,
  Typography,
  Checkbox,
  FormControlLabel,
  Alert,
  CircularProgress,
} from '@mui/material';
import { Link, useNavigate } from 'react-router-dom';
import InputMask from 'react-input-mask';
import { useFetch } from '../../hooks';
import { API, getURI } from '../../services';
import {
  isEmail,
  isNotEmpty,
  isEqualToOtherValue,
  hasMinLength,
} from '../../util/validation';

interface IInsertBody {
  name: string;
  cpf: string;
  cellphone: string;
  email: string;
  password: string;
  confirmPassword: string;
  agreeStatute: boolean;
  agreeRegimentoInterno: boolean;
  agreeLGPD: boolean;
  username?: string;
}

export const Signup: React.FC = () => {
  const navigate = useNavigate();

  const initialState: IInsertBody = {
    name: '',
    cpf: '',
    cellphone: '',
    email: '',
    password: '',
    confirmPassword: '',
    agreeStatute: false,
    agreeRegimentoInterno: false,
    agreeLGPD: false,
  };

  const [formState, setFormState] = useState<IInsertBody>(initialState);
  const [errors, setErrors] = useState<string[]>([]);
  const [formError, setFormError] = useState<string | undefined>();
  const [successMessage, setSuccessMessage] = useState<string | undefined>();

  // useFetch hook — assume signature: useFetch<T>({ method }) returns { doFetch, data, error, isLoading? }
  const { doFetch: doser, data, error } = useFetch<any>({ method: 'POST' });

  const stripNonDigits = (value: string) => value.replace(/\D/g, '');

  useEffect(() => {
    // on success
    if (data) {
      setSuccessMessage('Cadastro realizado com sucesso. Você será redirecionado para o login.');
      // opcional: limpar formulário
      setFormState(initialState);

      // após 2s redireciona para login (ou remova se preferir)
      const t = setTimeout(() => {
        navigate('/login');
      }, 2000);

      return () => clearTimeout(t);
    }
  }, [data, navigate]);

  useEffect(() => {
    if (error) {
      // se seu useFetch devolve error.message
      setFormError(typeof error === 'string' ? error : error!.message ? error!.message : 'Erro ao criar usuário');
    } else {
      setFormError(undefined);
    }
  }, [error]);

  // manipulador de envio
  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    setErrors([]);
    setFormError(undefined);
    setSuccessMessage(undefined);

    const {
      name,
      cpf,
      cellphone,
      email,
      password,
      confirmPassword,
      agreeStatute,
      agreeRegimentoInterno,
      agreeLGPD,
    } = formState;

    const errorMessages: string[] = [];

    if (!isNotEmpty(name) || !hasMinLength(name, 10)) {
      errorMessages.push('Nome completo deve ter no mínimo 10 caracteres');
    }

    if (!isNotEmpty(cpf) || stripNonDigits(cpf).length !== 11) {
      errorMessages.push('CPF deve ter exatamente 11 dígitos');
    }

    if (!isNotEmpty(cellphone) || stripNonDigits(cellphone).length < 11) {
      errorMessages.push('Telefone deve ter no mínimo 11 dígitos');
    }

    if (!isNotEmpty(email) || !isEmail(email)) {
      errorMessages.push('Digite um E-mail válido');
    }

    if (!isNotEmpty(password) || !hasMinLength(password, 6)) {
      errorMessages.push('Senha deve ter no mínimo 6 caracteres');
    }

    if (!isEqualToOtherValue(password, confirmPassword)) {
      errorMessages.push('Senha e Confirmação da Senha devem coincidir');
    }

    if (!agreeStatute) {
      errorMessages.push('Confirme o entendimento do Estatuto CPVL');
    }

    if (!agreeRegimentoInterno) {
      errorMessages.push('Confirme o entendimento do Regimento Interno CPVL');
    }

    if (!agreeLGPD) {
      errorMessages.push('Confirme o entendimento da LGPD');
    }

    if (errorMessages.length > 0) {
      setErrors(errorMessages);
      return;
    }

    // Preparar payload: sanitiza cpf/cell e extrai username
    const cleanedCpf = stripNonDigits(cpf);
    const cleanedCellphone = stripNonDigits(cellphone);
    const normalizedEmail = String(email).trim().toLowerCase();
    const username = normalizedEmail.includes('@') ? normalizedEmail.split('@')[0] : normalizedEmail;

    const payload: IInsertBody = {
      ...formState,
      cpf: cleanedCpf,
      cellphone: cleanedCellphone,
      email: normalizedEmail,
      username,
    };

    // Envia via useFetch — seu hook espera { url, body }
    doInsertUser({ url: getURI(API.insertUser), body: payload });
  };

  const handleReset = () => {
    setFormState(initialState);
    setErrors([]);
    setFormError(undefined);
    setSuccessMessage(undefined);
  };

  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value, type, checked } = e.target;
    setFormState((prevState) => ({
      ...prevState,
      [name]: type === 'checkbox' ? checked : value,
    }));
    setFormError(undefined);
    setErrors([]);
  };

  return (
    <Box
      sx={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        minHeight: '81vh',
        backgroundColor: '#f4f6f8',
      }}
    >
      <Box
        sx={{
          width: '100%',
          maxWidth: 400,
          padding: 3,
          borderRadius: 2,
          backgroundColor: 'white',
          boxShadow: 3,
        }}
      >
        <Typography variant="h4" align="center" mb={2}>
          Cadastre-se
        </Typography>
        <Typography variant="body2" align="center" mb={4}>
          Preencha os campos abaixo para criar sua conta.
        </Typography>

        {formError && (
          <Alert severity="error" sx={{ mb: 2 }}>
            {formError}
          </Alert>
        )}

        {successMessage && (
          <Alert severity="success" sx={{ mb: 2 }}>
            {successMessage}
          </Alert>
        )}

        <form onSubmit={handleSubmit}>
          <TextField
            fullWidth
            label="Nome completo"
            name="name"
            value={formState.name}
            onChange={handleChange}
            variant="outlined"
            margin="normal"
            required
          />

          <InputMask mask="999.999.999-99" value={formState.cpf} onChange={handleChange}>
            {(inputProps: any) => (
              <TextField
                {...inputProps}
                fullWidth
                label="CPF"
                name="cpf"
                variant="outlined"
                margin="normal"
                required
              />
            )}
          </InputMask>

          <InputMask mask="(99) 99999-9999" value={formState.cellphone} onChange={handleChange}>
            {(inputProps: any) => (
              <TextField
                {...inputProps}
                fullWidth
                label="Telefone"
                name="cellphone"
                variant="outlined"
                margin="normal"
                required
              />
            )}
          </InputMask>

          <TextField
            fullWidth
            label="E-mail"
            name="email"
            type="email"
            value={formState.email}
            onChange={handleChange}
            variant="outlined"
            margin="normal"
            required
          />

          <TextField
            fullWidth
            label="Senha"
            name="password"
            type="password"
            value={formState.password}
            onChange={handleChange}
            variant="outlined"
            margin="normal"
            required
          />

          <TextField
            fullWidth
            label="Confirme a senha"
            name="confirmPassword"
            type="password"
            value={formState.confirmPassword}
            onChange={handleChange}
            variant="outlined"
            margin="normal"
            required
          />

          <FormControlLabel
            control={
              <Checkbox name="agreeStatute" checked={formState.agreeStatute} onChange={handleChange} />
            }
            label={
              <Box component="span">
                Li e concordo com o{' '}
                <Link to="/docs/EstatutoCPVL_2023.pdf" download target="_blank">
                  <Typography component="span" lineHeight={2} fontSize="18px" fontFamily="Flamenco, system-ui" fontWeight="400">
                    Estatuto CPVL
                  </Typography>
                </Link>
              </Box>
            }
          />

          <FormControlLabel
            control={
              <Checkbox
                name="agreeRegimentoInterno"
                checked={formState.agreeRegimentoInterno}
                onChange={handleChange}
              />
            }
            label={
              <Box component="span">
                Li e concordo com o{' '}
                <Link to="/docs/RegimentoInternoCPVL_2024.pdf" download target="_blank">
                  <Typography component="span" lineHeight={2} fontSize="18px" fontFamily="Flamenco, system-ui" fontWeight="400">
                    Regimento Interno CPVL
                  </Typography>
                </Link>
              </Box>
            }
          />

          <FormControlLabel
            control={<Checkbox name="agreeLGPD" checked={formState.agreeLGPD} onChange={handleChange} />}
            label={
              <Box component="span">
                Li e concordo com a{' '}
                <Link to="/docs/lgpd_cpvl.pdf" download target="_blank">
                  <Typography component="span" lineHeight={2} fontSize="18px" fontFamily="Flamenco, system-ui" fontWeight="400">
                    LGPD
                  </Typography>
                </Link>
              </Box>
            }
          />

          {errors.length > 0 && (
            <Box sx={{ marginTop: 2 }}>
              {errors.map((err, idx) => (
                <Alert key={idx} severity="error" sx={{ marginBottom: 1 }}>
                  {err}
                </Alert>
              ))}
            </Box>
          )}

          <Box sx={{ marginTop: 2 }}>
            <Button
              variant="outlined"
              color="primary"
              type="button"
              fullWidth
              sx={{ marginBottom: 2 }}
              onClick={handleReset}
              disabled={isLoading}
            >
              Limpar
            </Button>

            <Button
              variant="contained"
              type="submit"
              fullWidth
              sx={{ bgcolor: '#1f5388' }}
              disabled={isLoading}
              startIcon={isLoading ? <CircularProgress size={18} /> : undefined}
            >
              {isLoading ? 'Cadastrando...' : 'Cadastrar'}
            </Button>
          </Box>
        </form>

        <Box sx={{ marginTop: 3 }}>
          <Typography variant="body2" align="center">
            Já tem conta?{' '}
            <Link to="/login" style={{ textDecoration: 'underline', color: '#1f5388' }}>
              Faça login
            </Link>
          </Typography>
        </Box>
      </Box>
    </Box>
  );
};
